import React, { useState } from 'react';
import { PhoneIcon, UsersIcon } from '@heroicons/react/24/outline';
import DialPad from './DialPad';
import Contacts1 from './Contacts1';

const NewUI = ({ darkMode }) => {
  const [activeTab, setActiveTab] = useState('dialpad');

  return (
    <div className={`bg-white dark:bg-gray-800 rounded-lg shadow-lg overflow-hidden transition-all duration-300 ${darkMode ? 'dark' : ''}`}>
      <div className="flex justify-center space-x-4 p-4 bg-gray-100 dark:bg-gray-700 border-b border-gray-200 dark:border-gray-600">
        <button
          className={`flex items-center justify-center px-5 py-2 rounded-full transition-all duration-200 ${
            activeTab === 'dialpad'
              ? 'bg-blue-500 text-white shadow-md'
              : 'bg-white dark:bg-gray-600 text-gray-700 dark:text-gray-200 hover:bg-blue-100 dark:hover:bg-gray-500'
          }`}
          onClick={() => setActiveTab('dialpad')}
        >
          <PhoneIcon className="h-5 w-5 mr-2" />
          Dialpad
        </button>
        <button
          className={`flex items-center justify-center px-5 py-2 rounded-full transition-all duration-200 ${
            activeTab === 'contacts'
              ? 'bg-blue-500 text-white shadow-md'
              : 'bg-white dark:bg-gray-600 text-gray-700 dark:text-gray-200 hover:bg-blue-100 dark:hover:bg-gray-500'
          }`}
          onClick={() => setActiveTab('contacts')}
        >
          <UsersIcon className="h-5 w-5 mr-2" />
          Contacts
        </button>
      </div>

      <div className="p-6 max-h-[calc(100vh-200px)] overflow-y-auto">
        {activeTab === 'dialpad' ? <DialPad darkMode={darkMode} /> : <Contacts1 darkMode={darkMode} />}
      </div>
    </div>
  );
};

export default NewUI;
